import React from 'react'
import Button from '@mui/material/Button'
import { useDispatch } from 'react-redux'
import { showRenewHistory } from '../actions/actions'
import GetRequest from '../scripts/GetRequest'

const ButtonJ = () => {
  const dispatch = useDispatch()
  const requestHistort = GetRequest.getHistory()

  return (
    <div>
      <Button onClick={() => dispatch({ type: showRenewHistory, data: requestHistort})}>
        Показать историю
      </Button>
    </div>
  )
}

export default ButtonJ
